li nil\u00fcferlere gidip bakard\u0131m \u00e7ocukken, babam, onlar\u0131n k\u00f6kleri olmad\u0131\u011f\u0131n\u0131 anlatm\u0131\u015ft\u0131 bana. neden bu \u00e7i\u00e7ekleri hep bir \u015feylere benzetmek i\u00e7in kulland\u0131klar\u0131n\u0131 ancak b\u00fcy\u00fcy\u00fcnce anlad\u0131m. Yaln\u0131zca bu \u00e7i\u00e7ekler, hep bir yerlere gidecekmi\u015f gibi azade ve \u00f6zg\u00fcr oluyorlar ama k\u00fc\u00e7\u00fck bir havuzun i\u00e7inde bir yere gitmeden ya\u015f\u0131yorlard\u0131. Hayat da b\u00f6yle bir \u015feydi benim i\u00e7in; hep bir yerlere gidecek gibi duran, yaln\u0131z ve bir yere gitmeyen bir \u00e7i\u00e7ek. B\u00fct\u00fcn bir hayat\u0131n \u00f6zeti buydu. bende bir yere ba\u011flanmad\u0131m ve bir yere gitmedim; \u00f6yle solgun nil\u00fcfer gibi bir havuzun i\u00e7inde yaln\u0131z ba\u015f\u0131na durdum, k\u00f6klerimi salamad\u0131m, ne, oldu\u011fum yere sa\u011flamca yerle\u015ftim, ne, ba\u015fka diyarlara ka\u00e7abildim. Bana bakanlar, beni seyredenler, beni sevenler oldu ama kimse yakas\u0131na takmad\u0131 beni, kimse odas\u0131na koymad\u0131, kimse beni sulay\u0131p b\u00fcy\u00fctmek i\u00e7in u\u011fra\u015fmad\u0131. Onlara ihtiyac\u0131m olmad\u0131\u011f\u0131n\u0131, havuzumda tek ba\u015f\u0131ma y\u00fczebilece\u011fimi d\u00fc\u015f\u00fcnd\u00fcler. Ben de bu y\u00fczden; kederi, yaln\u0131zl\u0131\u011f\u0131, kirlenmeyi \u00f6\u011frendim ve hayata benzedim. Ne garip ba\u015fka bir \u015fey de olmak istemedim, beni be\u011fenmeleri yetti bana.\"\n.\nAhmet Altan - Tehlikeli Masallar"}}]},"shortcode":"B9xR8N6FFeO","edge_media_to_comment":{"count":1},"taken_at_timestamp":1584309051,"dimensions":{"height":945,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/90038685_230204081358972_7464764579093118667_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=FWQJIA-Z1pYAX8fyXFg\u0026oh=83caf9c95b173d2d3fad513515bbdda3\u0026oe=5EA32035","edge_liked_
